aviciBayVoltageNotification = NotificationType((1, 3, 6, 1, 4, 1, 2474, 1, 4, 2, 0, 1)).setObjects(("AVICI-BAY-MIB", "aviciBayIndex"), ("AVICI-BAY-MIB", "aviciBayVoltageIndex"), ("AVICI-BAY-MIB", "aviciBayVoltage"), ("AVICI-BAY-MIB", "aviciBayVoltageStatus"), ("AVICI-SYSTEM-MIB", "aviciSysTrapDescr"))
if mibBuilder.loadTexts: aviciBayVoltageNotification.setStatus('current')
if mibBuilder.loadTexts: aviciBayVoltageNotification.setDescription('A Voltage notification is sent when a change is detected in the 5 volt backplane communication rails. These backplane communication rails are used by the bay controller to communicate with the occupant of a given slot. There are 8 rails, each servicing the slots in one half of a shelf in the bay (aviciBayVoltageIndex == rail): Rail Slots ============== 1 1 - 5 2 6 - 10 3 11 - 15 4 16 - 20 5 21 - 25 6 26 - 30 7 31 - 35 8 36 - 40 If the voltage is out of specification, the communication path will not function. When a given backplane communication channel is not functioning, modules serviced by this rail cannot be discovered (if a module is inserted) and will not be authorized to boot (if an existing module reboots). The current voltage is reported in the aviciBayVoltage object. A human readable description of the event triggering this notification is included in the aviciSysTrapDescr object.')
aviciBayFanNotification = NotificationType((1, 3, 6, 1, 4, 1, 2474, 1, 4, 2, 0, 2)).setObjects(("AVICI-BAY-MIB", "aviciBayIndex"), ("AVICI-BAY-MIB", "aviciBayFanIndex"), ("AVICI-BAY-MIB", "aviciBayFanCurrFailures"), ("AVICI-SYSTEM-MIB", "aviciSysTrapDescr"))
if mibBuilder.loadTexts: aviciBayFanNotification.setStatus('current')
if mibBuilder.loadTexts: aviciBayFanNotification.setDescription('A Fan notification is sent when the specified fan detects a fault or clears a fault. The current ambient air temperature entering the fan is reported in the aviciBayFanCurrTemp object. All existing fan faults are reported in the aviciBayFanCurrFailures object as a bitmap. If no failures exist, this object contains a 0. A human readable description of the event triggering this notification is included in the aviciSysTrapDescr object. Communication Failure: This failure indicates that the cooling module has been removed or the cooling module firmware is no longer communicating with the bay controller. If a communication failure occurs, the fans will run in autonomous mode until communication with the bay controller is reestablished. Once communication is established, the failure is cleared. General Failure: This failure indicates that the cooling module firmware is able to communicate with the bay controller and is reporting a broken fan. This could mean that the fan is burned out, jammed, or the firmware is unable to sense fan speed due to tachometer failure. When the problem is corrected, the failure is cleared. Filter Blocked: This failure indicates that the fan detected that the filter is blocked. When the obstruction is removed from the filter or the clogged air filter is replaced, this failure will clear. Bad or absent internal thermistor: This failure indicates that the fan internal thermistor is missing or is not functioning. If the thermister is not functioning, the fan cannot sense the incoming ambient air temperature. The ambient temperature is used to control fan speed in autonomous mode and when there are no modules reporting their current temperature. Bad or absent external thermistor: This failure indicates that the fan external thermistor is expected to be installed and is not functioning. Minor temperature threshold: This failure indicates that the incoming ambient air temperature is above the minor threshold temperature, but below the major threshold temperature. Either the cooling system in the building has failed, or it has insufficient cooling capacity for the equipment in the room. A rapid rise in temperature usually indicates cooling system failure whereas a slow rise usually indicates insufficient cooling capacity. When the temperature drops below the minor threshold, this failure will clear. Major temperature threshold: This failure indicates that the incoming ambient air temperature is above the major threshold temperature, but below the critical threshold temperature. Either the cooling system in the building has failed, or it has insufficient cooling capacity for the equipment in the room. A rapid rise in temperature usually indicates cooling system failure whereas a slow rise usually indicates insufficient cooling capacity. When the temperature drops below the major threshold, this failure will clear. Critical temperature threshold: This failure indicates that the incoming ambient air temperature is above the critical threshold temperature. Either the cooling system in the building has failed, or it has insufficient cooling capacity for the equipment in the room. A rapid rise in temperature usually indicates cooling system failure whereas a slow rise usually indicates insufficient cooling capacity. When the temperature drops below the critical threshold, this failure will clear.')
